import "./App.css";
import Events from "./components/Events";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
	return (
		<div className="App">
			<BrowserRouter>
				<Events />
				<Routes>
					<Route path="/" element={<Events />} />
					<Route path="/Events" element={<Events />} />
					<Route path="/twitter" element={<Events dataset={"twitter"} />} />
					<Route path="/imdb" element={<Events dataset={"imdb"} />} />
				</Routes>
			</BrowserRouter>
		</div>
	);
}

export default App;
